import React from 'react';
import { View } from 'react-native';
import GenericForm from './';

const fields = [
  { name: 'name', placeholder: 'Enter your name', rules: { required: 'Name is required.' } },
  { name: 'email', placeholder: 'Enter your email', rules: { required: 'Email is required.', pattern: { value: /\S+@\S+\.\S+/, message: 'Email is invalid.' } } },
  { name: 'password', placeholder: 'Enter your password', secureTextEntry: true, rules: { required: 'Password is required.', minLength: { value: 6, message: 'Password must be at least 6 characters.' } } },
];

const MyComponent = () => {
  const onSubmit = (data) => {
    // Handle form submission logic
    console.log('Form data:', data);
  };

  return (
    <View>
      <GenericForm fields={fields} onSubmit={onSubmit} />
    </View>
  );
};

export default MyComponent;
